import React from 'react';
import classes from './ServiceCard.module.css';

const serviceCard = (props) => {
    const list = props.services.map((service,index) => {
        return (<li key={index}><a href="/">{service}</a></li>);
    })
    return (
        <section>
            <div>{props.title}</div>
            <ul>
                {list}
            </ul>
        </section>
    );
}

export default serviceCard;
